import React from 'react';

export default function MalfunctionList(props) {

    const malfunctionItems = props.history.map((item, index) => {
      return (
        <li key={index}>
          <p>{item.code}</p>
          <p>{item.description}</p>
          <p>{item.time}</p>
          <p>{item.cost}</p>
        </li>
      );
    });

  return (

    <ul>

    </ul>
    
  );
}
